Here's an example implementation of bubble sort in JavaScript:
```scss
function bubbleSort(arr) {
  for (let i = 0; i < arr.length - 1; i++) {
    for (let j = 0; j < arr.length - 1 - i; j++) {
      if (arr[j] > arr[j + 1]) {
        let temp = arr[j];
        arr[j] = arr[j + 1];
        arr[j + 1] = temp;
      }
    }
  }
  return arr;
}
```
This function takes in an array as an argument and returns the sorted array. The bubble sort algorithm works by repeatedly comparing adjacent elements in the array and swapping them if they are out of order. The outer loop runs from 0 to n-1, and the inner loop runs from 0 to n-1-i. After each pass through the inner loop, the array should be sorted, but it continues until the end of the outer loop. The time complexity of bubble sort is O(n^2), which makes it less efficient than some other sorting algorithms, but it's still a simple and easy-to-understand algorithm.

