    // Callback function to be executed every 3 seconds
    printf("Periodic timer callback function called.\n");
}

int main() {
    // Initialize the timer
    InitializeTimer(1);

    // Start the timer
    SetTimer(0, 0, Freq, user_periodic_timer_callback);

    // Wait for the timer to expire
