3. The `SetTimer` function is called with a handle of 0 and the timer frequency in milliseconds, which is 30000. The user function to be called on timer expiration is also passed as a parameter.
4. The `WaitForSingleObject` function is called with a handle of the timer, which blocks the execution of the program until the timer expires.
5. The `KillTimer` function is called to stop the timer.

