    let x = 5;
    let const_x = &x; // create a const reference to x
    // attempt to modify x through the const reference
    *const_x = 10; // this is not allowed
}
```
It is important to respect the semantics of const references in Rust, as they are intended to provide a guarantee of immutability to the programmer and to other parts of the code. If you need to modify a value, you should use a mutable reference instead of a const reference.

