    "fmt"
    "github.com/davecgh/go-fuzzy"
    "log"
)

func main() {
    // Define the map to search
    mapOfStrings := map[string]string{
        "test": "test value",
        "tst":  "tst value",
        "tes":  "tes value",
    }

    // Define the fuzzy matching options
    options := fuzzy.WithIgnoreCase(true).WithFuzziness(3)

    // Fuzzy search the map
    result, err := fuzzy.Search(mapOfStrings, "Tst", options)

    if err!= nil {
        log.Fatal(err)
    }

    // Print the results
    for _, item := range result {
        fmt.Println(item.Key, item.Value)
    }
}
```

