Here is an example of a basic calculator program written in Python:

```python
def calculate(expression):
    # split the expression into tokens
    tokens = expression.split()

    # handle the different types of tokens
    if tokens[0] == '+':
        result = eval(tokens[1]) + eval(tokens[2])
    elif tokens[0] == '-':
        result = eval(tokens[1]) - eval(tokens[2])
    elif tokens[0] == '*':
        result = eval(tokens[1]) * eval(tokens[2])
    elif tokens[0] == '/':
        result = eval(tokens[1]) / eval(tokens[2])
    else:
        raise ValueError('Invalid operator')

    return result

# main function that handles user input and displays the result
def main():
    while True:
        # get user input
        try:
            expression = input("Enter an expression: ")
            break
        except EOFError:
            print("Please enter an expression")

        # calculate the result
        result = calculate(expression)

        # print the result
        print("The result is:", result)

# run the main function
if __name__ == "__main__":
    main()
```

This program takes user input and evaluates the expression. It supports basic arithmetic operators (+, -, \*, /) and raises an error if the user enters an invalid operator. The program uses the built-in `eval()` function to evaluate the tokens as expressions.

